@KyivPost: Another incredible victory for Ukraine🥊🇺🇦

In the final of the Olympic boxing tournament (up to 80 kg), Ukrainian Oleksandr Khyzhniak defeated Nurbek Oralbay from Kazakhstan with a score of 3:2.

This is Ukraine’s third gold medal at the 2024 Olympics. https://t.co/pDzcS5JaPP

